	function replyDate2(valid)
	{
	    processReply(valid, "next_billing_date", "next_billing_date-error", "Invalid date; use YYYY-MM-DD");
	}
	function checkEmail()
	{
	    Validator.EmailValid(dwr.util.getValue("email_address"), replyEmail);
	}
	
	function replyEmail(valid)
	{
	    processReply(valid, "email_address", "email_address-error", "Invalid email address");
	}
	function checkUrl()
	{
	    Validator.URLValid(dwr.util.getValue("website_url"), replyUrl);
	}
	
	function replyUrl(valid)
	{
	    processReply(valid, "website_url", "website_url-error", "Enter website as http://sitename");
	}
	function checkCreditCard()
	{
	    Validator.CreditCardValid(dwr.util.getValue("card_number"), replyCreditCard);
	}
	
	function replyCreditCard(valid)
	{
	    processReply(valid, "card_number", "card_number-error", "Invalid card number");
	}
	function checkRequired(fieldName)
	{
		var theReply = "";
	    if (dwr.util.getValue(fieldName) == "") {
	    	processReply(false, fieldName, fieldName + "-error", " *Value required");
	    	theReply = "Missing field";
	    }
	  return theReply;
	}
	
	function replyCreditCard(valid)
	{
	    processReply(valid, "card_number", "card_number-error", "Invalid card number");
	}
	function processReply(valid, id, errid, error)
	{
	    if (valid)
	    {
	        dwr.util.setValue(errid, "");
	    }
	    else
	    {
	        dwr.util.setValue(errid, error);
	    }
	}
	</script>
