  </tr>
  <tr>
    <td style="background: #eee;">End Date</td>
    <td style="background: #eee;"><input class="inputbox" type="text" name="end_date" id="end_date" value="$ENDDATE$" />&nbsp; <a href="javascript:cal2.popup();"><img src="/js/img/cal.gif" border="0"></a></td>
  </tr>
  <tr>
    <td style="background: #eee;">Category</td>
    <td style="background: #eee;">$DDLBCAT$</td>
  </tr>
  <tr>
    <td style="background: #eee;">Author</td>
    <td style="background: #eee;">$DDLBAUTHOR$</td>
  </tr>
  <tr>
