INSERT INTO page_history VALUES (1, 1, '<h3>Who we are</h3>
generic_schema is an Internet Professional Services (IPS) firm that recognizes the importance of customer loyalty. Building relationships with your customers through interaction will win their business, and ultimately win their loyalty and respect. <br /><br />
<h3>What we do</h3>
Working with best of breed technology and a highly disciplined, methodical approach, we build Internet applications for our client base that do more than just give them a presence online; we build tools that allow them to reach their customers and provide valuable services to them. A website is not just an advertising medium; it is a tool that can help you grow your business and improve the way you interact with new and existing customers. <br /><br />We build, maintain and host multi-tiered web applications for clients across North America. Our development expertise extends to Java based applications, database design and management, graphic design, and highly interactive web applications. <br /><br />
<h3>Who we do it for</h3>
Our current customer base includes companies in the tourism sector, RFID markets, manufacturing, and engineering sector, among others.<br /><br />Isn&rsquo;t it time you demanded more from your e-Business relationships?', '2007-05-11 16:46:38.402467');
